import React from 'react';
import styled from 'styled-components';

const Sidebar = () => {
    return (
        <SidebarOuter>

            <SidebarTitle>
                Categories
            </SidebarTitle>

            <CategoryName>Electric Guitars</CategoryName>

        </SidebarOuter>
    )
}

export default Sidebar;

const CategoryName = styled.p`
background: #e5e5e5;
padding-left: 5px;
`

const SidebarTitle = styled.h4`
    text-align: center;
    color: white;
    background: #49B4FF;
    padding-top: 5px;
    padding-bottom: 5px;
`

const SidebarOuter = styled.div`

    width:100%;
    display: grid;
    grid-template-columns: auto;
`
